package refineimg

import (
	"bytes"
	"encoding/base64"
	"fmt"
	"image/jpeg"
	"log"
	"os"
	"testing"

	"golang.org/x/image/webp"
)

const (
	inWebpBase64  = ""
	ansWebpBase64 = ""
	ciWebpBase64  = ""

	inWebpWithAlphaBase64  = "UklGRnYAAABXRUJQVlA4WAoAAAAQAAAAYwAAYwAAQUxQSBAAAAABB9CeiAgACeH/fiGi/6lEVlA4IEAAAACwBQCdASpkAGQAPpFIoUylpCMiIKgAsBIJaW7hc+AAY2upvcReWAa6m9xF5YBrqb3EXlgGngAA/v81aVcAAAAA"
	ansWebpWithAlphaBase64 = ""
)

func TestPerform(t *testing.T) {
	input, err := base64.StdEncoding.DecodeString(inWebpBase64)
	if err != nil {
		log.Fatal(err)
	}
	output := Perform(input)
	outWebpBase64 := base64.StdEncoding.EncodeToString(output)
	if outWebpBase64 != ansWebpBase64 && outWebpBase64 != ciWebpBase64 {
		t.Error("output is not as expected:")
		t.Error(outWebpBase64)
		img, err := webp.Decode(bytes.NewReader(output))
		if err != nil {
			log.Fatal(err)
		}
		toimg, _ := os.Create("out.jpg")
		defer toimg.Close()
		jpeg.Encode(toimg, img, nil)
	}
}

func TestPerformImageWithAlphaChannel(t *testing.T) {
	input, err := base64.StdEncoding.DecodeString(inWebpWithAlphaBase64)
	if err != nil {
		log.Fatal(err)
	}
	output := Perform(input)
	outWebpBase64 := base64.StdEncoding.EncodeToString(output)
	fmt.Println(outWebpBase64)
	if outWebpBase64 != ansWebpWithAlphaBase64 {
		t.Error("output is not as expected:")
		t.Error(outWebpBase64)
		img, err := webp.Decode(bytes.NewReader(output))
		if err != nil {
			log.Fatal(err)
		}
		toimg, _ := os.Create("out.jpg")
		defer toimg.Close()
		jpeg.Encode(toimg, img, nil)
	}
}
